    public static LineaireValues algoLineaire(int tableau[]) {

        int m[] = new int[tableau.length];

        int maximum = tableau[0];
        int indiceMAX = 0, indiceMIN = 0;

        m[0] = tableau[0];
        for (int i = 1; i < tableau.length; i++) {
            if (m[i - 1] >= 0) {
                m[i] = m[i - 1] + tableau[i];
            } else {
                m[i] = tableau[i];
                indiceMIN = i;
            }
            if (m[i] > maximum) {
                maximum = m[i];
            }
            if (m[i] > 0 && m[i - 1] < 0 && m[i+1]< 0) {
                indiceMIN = i;
                indiceMAX = i;
            }
     
            if (m[i] > 0 && m[i - 1] > 0 && tableau[i-1] + m[i]>m[i]) {
                indiceMAX = i;
            }
        }

        return new LineaireValues(indiceMIN, indiceMAX, maximum);
    }

